HammingDistance = __import__('03_HammingDistance')

def ApproximatePatternMatching(Text, Pattern, d):
    positions = [] # initializing list of positions
    k = len(Pattern)
    for i in range(0, len(Text)-k+1):
        if HammingDistance.HammingDistance(Text[i:i+k], Pattern) <= d:
            positions.append(i)
    return positions

Text = ''
Pattern = 'TGTATCGTACGT'
d = 5
print(*ApproximatePatternMatching(Text, Pattern, d))